import "./App.css";
import Sidebar from "./components/Sidebar";
import Chat from "./components/Chat";
import { Route, Switch, Redirect } from "react-router-dom";

function App() {
  return (
    <div className="app">
      <div className="app_body">
          <Sidebar />
        <Switch>
          <Route path="/rooms/:roomId">
            <Chat />
          </Route>
          <Route path="*">
            <h1>Invalid URL</h1>
          </Route>
        </Switch>
      </div>
    </div>
  );
}

export default App;
